import React from "react";
import Avatar from "@material-ui/core/Avatar";

function BookAvatar() {
	return (
		<div>
			<div className="book-logo">
				<Avatar alt="logo" src="logo.jpg" />
			</div>
		</div>
	);
}

export default BookAvatar;
